import React from "react";
import { View, Text, StyleSheet } from "react-native";

const ActiveScreen = () => {
  return (
    <View style={StyleSheet.container}>
      <Text>All Screen</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: "center",
    backgroundColor: "#fff",
    justifyContent: "center",
  },
});

export default ActiveScreen;
